import React from 'react';
import axios from 'axios';

import ShortParagraph from '../images/wireframe/short-paragraph.png';
import WireframeImage from '../images/wireframe/image.png';

import { 
  Button, Dimmer, Image, Loader, Input, Divider, Grid, Form 
} from 'semantic-ui-react';

class SaveImage extends React.Component {
  state = {
    isLoad: false,
    isSaveImage: false,
    value: '',
    imageUrl: 'data:image/png;base64,'
  };

  componentDidMount() {
    setTimeout(_ => {
      this.setState({
        isLoad: true,
      });
    }, 1000);
  }

  saveFile = () => {
    this.setState({
      isSaveImage: true,
    });

    const { auth_token } = this.props;
    const base64 = this.state.imageUrl;

    const boundary = '-------314159265358979323846';
    const delimiter = `\r\n--${boundary}\r\n`;
    const close_delim =  `\r\n--${boundary}--`;

    const contentType = 'image/png';
    const base64Str = base64.split(',')[1];

    const metadata = {
      'name': this.state.value,
      'mimeType': contentType
    };

    const body = `${delimiter}` +
      `Content-Type: application/json; charset=UTF-8\r\n\r\n` +
      `${JSON.stringify(metadata)}` +
      `${delimiter}` +
      `Content-Type: ${contentType}\r\n` +
      `Content-Transfer-Encoding: base64\r\n\r\n` +
      `${base64Str}` +
      `${close_delim}`;

    axios.post(
      'https://www.googleapis.com/upload/drive/v3/files',
      body,
      {
        params: {
         'uploadType': 'multipart'
        },
        headers: {
         'Content-Type': `multipart/related; boundary="${boundary}"`,
         'Authorization': `Bearer ${auth_token}`
        }
      }
    ).then(
      res => {
        console.log(res);
        this.setState({
          isSaveImage: false,
        });
      },
      console.error
    );
  }

  onChange = event => {
    this.setState({
      value: event.target.value
    });
  }

  render() {
    const { isLoad, imageUrl, value, isSaveImage } = this.state;

    return (
      <div className="save-image-container">
        {!isLoad && (
          <Dimmer.Dimmable dimmed={true}>
            <Dimmer active={true} inverted>
              <Loader>Загрузка</Loader>
            </Dimmer>

            <p>
              <Image src={WireframeImage} size='medium' rounded centered />
            </p>
            <p>
              <Image src={ShortParagraph} />
            </p>
            <p>
              <Image src={ShortParagraph} />
            </p>
          </Dimmer.Dimmable>
        )}

        {isLoad && (
          <Form>
            <p>
              <Image src={imageUrl} fluid rounded />
            </p>

            <Divider />

            <Grid columns={2}>
              <Grid.Row>
                <Grid.Column width={10}>
                  <Input 
                    focus
                    placeholder='Введите название' 
                    fluid 
                    onChange={this.onChange}
                    value={value} />
                </Grid.Column>
                <Grid.Column width={6} textAlign='right'>
                  <Button 
                    color='teal'
                    disabled={!value.length || isSaveImage}
                    onClick={this.saveFile}>
                      Сохранить
                  </Button>
                </Grid.Column>
              </Grid.Row>
            </Grid>
            
            {isSaveImage && <Dimmer active inverted>
              <Loader inverted>Сохранение</Loader>
            </Dimmer>}
          </Form>
        )}
      </div>
    ); 
  }
}

export default SaveImage;